import React, { useState, Component } from 'react';
import logo from './logo.svg';
import './App.css';
import List from "./components/List";
import AddToList from './components/AddToList';

export interface IState {
    toys: {
        classType: string
        name: string
        size: string
        producerId : number
        numberOfWheels? : number
        url: string
        note?: string
    }[]
}

function App() {

  const [toys, setToys] = useState<IState["toys"]>([{
      classType: "Car",
      name: "Ford GT40 ",
      size: "XL",
      producerId: 1,
      numberOfWheels: 4,
      url: "https://www.google.com/imgres?imgurl=https%3A%2F%2Fupload.wikimedia.org%2Fwikipedia%2Fcommons%2Fthumb%2F1%2F1f%2FFord_GT40_%252839430889701%2529_noBG.jpg%2F1200px-Ford_GT40_%252839430889701%2529_noBG.jpg&imgrefurl=https%3A%2F%2Fde.wikipedia.org%2Fwiki%2FFord_GT40&tbnid=AFVGOTpWXtEj6M&vet=12ahUKEwiBje2rufn7AhXOmycCHbryAtIQMygAegUIARDjAQ..i&docid=ncWUPCB-S4ZjAM&w=1200&h=720&q=ford%20gt40&client=firefox-b-e&ved=2ahUKEwiBje2rufn7AhXOmycCHbryAtIQMygAegUIARDjAQ",
      note: "Cutest lady in the universe",
  }
  ])

  return (
      <div className="App">
        <h1>.:EOS:. Toy Store</h1>
          <h2>Toys in the inventory</h2>
        <List toys={toys}/>
        <AddToList setToys={setToys} toys={toys}/>
      </div>
  );
}

export default App;
